Dissected (BBC)

Health-Medical Documentary hosted by George McGavin, published by BBC in 2014 - English narration


Information
------------------------------

This ground-breaking two-part series takes us inside two of the most amazing structures in the natural world: our hands and feet. In a purpose-built dissection lab, Dr George McGavin is joined by leading anatomy experts.


1)  The Incredible Human Hand 
Dissecting a real hand, taking it apart layer by layer to reveal what makes it unique in the animal kingdom. We discover what gives our hands an unrivalled combination of power and precision, and meet people who use their hands in extraordinary ways - from magicians to rock climbers - to discover what gives them such astonishing abilities.

2)  The Incredible Human Foot 
Dissecting a real foot, taking it apart layer by layer to reveal what makes it unique in the animal kingdom. We discover the incredible natural engineering that is key to our greatest physical achievements, from a baby's first steps to a ballerina on pointe.

